import React from 'react';
import './Menu.scss';

class Menu extends React.Component {
  render() {
    return (
      <div className="lm-menu-box">
        <div className="lm-menu-backdrop"></div>
        <div className="lm-menu-content"></div>
      </div>
    );
  }
}

export default Menu;
